import React from "react"
import ProjectCard from './ProjectCard.js'
import './App.css';


const projects = [
    {link:"/proj1", image:art, title:"Mystery", category:"film"},
    {link:"/proj2", image:rem, title:"R.E.M.", category:"film"},
    {link:"/proj3", image:luk, title:"", category:"film"},
    {link:"/proj4", image:merlot, title:"merlot", category:"film"},
    {link:"/proj5", image:nyc, title:"nyc", category:"film"}
]

function renderList(items) {
    var list = items.map(item => { 
      return <ProjectCard link={item.link} image = {item.image} title={item.title} category={item.catergory}/>
    });
    return list;
  }


function Project(props) {
  return (
    <div>
      <h1>Project</h1>
      {/* {renderList(projects)} */}

    </div>
  )
}


export default Project;
